function generateInstructions(path){
	var output;
	var iterations = path.split("|");
	for (var iteration = 0; iteration < iterations.length; iteration++) {
		var iterationCommand = "Row " + (iteration + 1) + ": " + iterations[iteration].length + " pixels\r\n";
		
		var currentPixel = iterations[iteration][0];
		var pixelCount = 1;
		for (var pixel = 1; pixel < iterations[iteration].length; pixel++) {
			if (currentPixel == iterations[iteration][pixel]){
				pixelCount++;
			}
			else {
				iterationCommand += pixelCount + " " + currentPixel + "\r\n";
				currentPixel = iterations[iteration][pixel];
				pixelCount = 1;
			}
		}
		iterationCommand += pixelCount + " " + currentPixel + "\r\n\r\n";
		output += iterationCommand;
	}
	return output;
}

function generateMap(data){
	var rows = data.split("|");
	
	var map = [];
	for (var i = 0; i < rows.length; i++){
		map[i] = rows[i].split(","); // these are the columns
	}
	
	return map;
}

function getNumberOfCellsPerIteration(iterations, iteration, smallestCount) {
	var numberOfCellsInThisIteration = smallestCount;
	if (iteration + 1 < smallestCount) {
		numberOfCellsInThisIteration = iteration + 1;
	}
	if (iterations - iteration < smallestCount) {
		numberOfCellsInThisIteration = iterations - iteration;
	}
	return numberOfCellsInThisIteration;
}

function makePath(map){
	var path = "";
	
	var rowCount = map.length;
	var colCount = 0;
	if(map[0].length > 0){
		colCount = map[0].length;
	}
	
	var smallestCount = 0;
	var largestCount = 0
	if (rowCount < colCount) {
		smallestCount = rowCount;
		largestCount = colCount;
	} else if (colCount < rowCount) {
		smallestCount = colCount;
		largestCount = rowCount;
	} else { // rowCount and colCount are equal
		smallestCount = rowCount;
		largestCount = rowCount;
	}
	
	var iterations = rowCount + colCount - 1;
	var startWith = "col";
	
	for (var iteration = 0; iteration < iterations; iteration++) { // loop through every iteration
		path = path;
		var message = "iteration: " + iteration;
		if (startWith == "row") {
			startWith = "col";
			var initialX = 0;
			
			if (iteration + 1 - smallestCount > 0) {
				initialX = iteration + 1 - smallestCount;
			}
			
			for (var i = 0; i < getNumberOfCellsPerIteration(iterations, iteration, smallestCount); i++) {
				var x = initialX + i;
				var y = 0;

				if (iteration - x > 0) {
					y = iteration - x;
				}
				
				message = message + ", (" + x + "," + y + ")=" + map[x][y];
				path = path + map[x][y];
			}
		} else {
			startWith = "row";
			var initialX = iteration;
			
			if (iteration > rowCount - 1){
				initialX = rowCount - 1;
			}
			for (var i = 0; i < getNumberOfCellsPerIteration(iterations, iteration, smallestCount); i++) {
				var x = initialX - i;
				var y = 0;
				if (x > rowCount - 1) {
					x = rowCount - 1;
				}
				if (iteration - x > 0) {
					y = iteration - x;
				}
				message = message + ", (" + x + "," + y + ")=" + map[x][y];
				path = path + map[x][y];
			}
		}
		if (iteration + 1 != iterations) {
			path += "|";
		}
		//console.log(message);
	}
	return path;
}
